import React, { useState } from "react";
import Axios from "axios";

function Mobile() {
  const [number, setNumber] = useState("");
  const [otp, setOtp] = useState("");

  const hadnleClick = () => {
    alert("hii");
    Axios.post(`http://localhost:8000/mobile`, { number }).then((res) => {
      console.log("response", res);
    });
  };

  const onClick = () => {
    alert("hii");
    Axios.post(`http://localhost:8000/otp`, { number }).then((res) => {
      console.log("response", res);
    });
  };

  const handleChange = (event) => {
    setNumber(event.target.value);
  };

  const onChange = (event) => {
      setOtp(event.target.value)
  }

  console.log("number", number);
  return (
    <div>
      <input type="number" onChange={handleChange} value={number} />
      <button type="button" onClick={hadnleClick}>
        submit number
      </button>
      <input type="number" onChange={onChange} value={number} />
      <button type="button" onClick={onClick}>
        submit otp
      </button>
    </div>
  );
}

export default Mobile;
